import React, { useState } from "react";
import { motion } from "framer-motion";
import { Menu, X, Home, Book, FileText, Info } from "lucide-react";

export default function AdminLayout({ children }) {
  const [open, setOpen] = useState(true);

  return (
    <div className="flex h-screen bg-gray-100 dark:bg-slate-900">
      {/* Sidebar */}
      <motion.aside
        animate={{ width: open ? 260 : 70 }}
        className="h-full bg-white dark:bg-slate-800 shadow-xl flex flex-col border-r border-gray-200 dark:border-slate-700"
      >
        <div className="flex items-center justify-between p-4 border-b border-gray-200 dark:border-slate-700">
          <span className={`font-bold text-xl text-slate-800 dark:text-white ${!open && "hidden"}`}>Admin</span>
          <button onClick={() => setOpen(!open)} className="p-2">
            {open ? <X size={22} /> : <Menu size={22} />}
          </button>
        </div>

        {/* Menu */}
        <nav className="flex-1 p-4 space-y-2">
          {[
            { icon: <Home />, label: "Dashboard" },
            { icon: <Book />, label: "Books" },
            { icon: <FileText />, label: "Blogs" },
            { icon: <Info />, label: "About" },
          ].map((item, i) => (
            <motion.div
              key={i}
              whileHover={{ scale: 1.03 }}
              className="flex items-center gap-3 p-3 rounded-xl cursor-pointer bg-gray-100 dark:bg-slate-700/40 hover:bg-amber-200 dark:hover:bg-amber-600 text-slate-800 dark:text-white"
            >
              {item.icon}
              {open && <span className="font-medium">{item.label}</span>}
            </motion.div>
          ))}
        </nav>
      </motion.aside>

      {/* Main Content */}
      <div className="flex-1 flex flex-col">
        {/* Top Bar */}
        <header className="h-16 bg-white dark:bg-slate-800 shadow flex items-center justify-between px-6 border-b border-gray-200 dark:border-slate-700">
          <h1 className="text-xl font-semibold text-slate-800 dark:text-white">Admin Panel</h1>
          <div className="flex items-center gap-4">
            <div className="w-10 h-10 rounded-full bg-gray-300" />
          </div>
        </header>

        <main className="p-6 overflow-y-auto">{children}</main>
      </div>
    </div>
  );
}

// Example Dashboard Page
export function Dashboard() {
  return (
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
      {["Total Books", "Total Blogs", "Users", "Messages"].map((title, i) => (
        <motion.div
          key={i}
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: i * 0.1 }}
          className="p-6 bg-white dark:bg-slate-800 rounded-2xl shadow hover:shadow-xl duration-200"
        >
          <h2 className="text-lg font-semibold text-slate-700 dark:text-white">{title}</h2>
          <p className="mt-2 text-3xl font-bold text-amber-600">0</p>
        </motion.div>
      ))}
    </div>
  );
}

// Books Panel
export function BooksPanel() {
  return (
    <div className="p-6 bg-white dark:bg-slate-800 rounded-2xl shadow">
      <h2 className="text-2xl font-bold mb-4 text-slate-800 dark:text-white">Books</h2>
      <p className="text-slate-600 dark:text-slate-300">Add / Edit / Delete Books</p>
    </div>
  );
}

// Blogs Panel
export function BlogsPanel() {
  return (
    <div className="p-6 bg-white dark:bg-slate-800 rounded-2xl shadow">
      <h2 className="text-2xl font-bold mb-4 text-slate-800 dark:text-white">Blogs</h2>
      <p className="text-slate-600 dark:text-slate-300">Manage blog posts</p>
    </div>
  );
}

// About Panel
export function AboutPanel() {
  return (
    <div className="p-6 bg-white dark:bg-slate-800 rounded-2xl shadow">
      <h2 className="text-2xl font-bold mb-4 text-slate-800 dark:text-white">About Section</h2>
      <p className="text-slate-600 dark:text-slate-300">Update about information</p>
    </div>
  );
}
